import System.IO
import Data.Text (splitOn, pack, unpack)
import Data.List (findIndex, findIndices, sortBy)
import Data.Maybe (fromJust)

data Data = Data (Either Integer [Data]) deriving Eq
type Pair = (Data, Data)

isSmaller :: Data -> Data -> Bool
isSmaller (Data (Left left)) (Data (Left right)) = left < right
isSmaller (Data (Right [])) (Data (Right (_:_))) = True
isSmaller (Data (Right (_:_))) (Data (Right [])) = False 
isSmaller (Data (Right [])) (Data (Right [])) = True -- Shut up and work already
isSmaller (Data (Right (left:restLeft))) (Data (Right (right:restRight)))
    | left == right = Data (Right restLeft) `isSmaller` Data (Right restRight)
    | otherwise = left `isSmaller` right
isSmaller (Data (Left left)) (Data (Right right)) = Data (Right [Data (Left left)]) `isSmaller` Data (Right right) 
isSmaller (Data (Right left)) (Data (Left right)) = Data (Right left) `isSmaller` Data (Right [Data (Left right)])  

problem13_1 :: [Pair] -> Integer
problem13_1 pairs = 
    sum $ map fst $
        filter (\(_, (left, right)) -> left `isSmaller` right) $
            zip [1..(toInteger $ length pairs)] pairs

-- problem13_2 :: [Pair] -> Integer
problem13_2 pairs = 
    let
        sep1 = Data (Right [Data (Right [Data (Left 2)])])
        sep2 = Data (Right [Data (Right [Data (Left 6)])])
        results = map (+ 1) $ findIndices
            (\x -> x == sep1 || x == sep2)
                (sortBy (\left right -> if left `isSmaller` right then LT else GT)
                    (sep1:sep2:concatMap (\(a, b) -> [a, b]) pairs))
    in
        toInteger $ product results

parseList :: String -> Integer -> (Data, Integer)
parseList str index =
    if (str !! fromInteger index) == ']' then
        (Data $ Right [], index)
    else  
        let
            (dat, newIndex) = parse' str index
            (Data (Right list), returnIndex) = parseList str newIndex
        in
            (Data $ Right (dat:list), returnIndex)

parse' :: String -> Integer -> (Data, Integer)
parse' str index = 
    let
        text = reverse $ take (length str - fromInteger index - 1) $ reverse str 
    in
        if head text == '[' then
            let
                (dat, newIndex) = parseList str (index + 1)
            in
                (dat, newIndex + 1) 
        else
            let 
                end = fromJust $ findIndex (\c -> c == ',' || c == ']') text
            in
                (Data $ Left ((read $ take end text) :: Integer), toInteger end + 1) 

parse :: String -> Pair
parse str = 
    let
        [left, right] = lines str
    in
        (fst $ parse' left 0, fst $ parse' right 0)

